// PDF.js Worker stub - 워커 없이 메인 스레드에서 실행
// This is a minimal worker implementation for PDF.js to work without a separate worker file
self.onmessage = function(e) {
  // Basic message handling
  console.log('PDF Worker received message:', e.data);
  
  // Return basic response
  self.postMessage({
    messageId: e.data.messageId,
    result: null
  });
};